def flag_features(machine, field_prefix):
    res = []
    res += list_of_bool_int_fields(machine,
                                   parent_field='{}_status_flags'.format(field_prefix),
                                   child_fields=stat_flags,
                                   description='The set of status flags the server returned '
                                               'in the initial HandshakePacket. Each entry corresponds '
                                               'to a bit being set in the flags; key names correspond to '
                                               'the #defines in the MySQL docs.')
    res += list_of_bool_int_fields(machine,
                                   parent_field='{}_capability_flags'.format(field_prefix),
                                   child_fields=cap_flags,
                                   description='''The set of capability flags the server returned in the 
                                   initial HandshakePacket. Each entry corresponds to a bit being set in 
                                   the flags; key names correspond to the #defines in the MySQL docs''')
    return res


def error_features(machine, field_prefix):
    res = [
        Feature(as_obj={
            '_id': '{}_ERROR_CODE'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_error_code'.format(field_prefix),
                               t='int'),
            'description': 'If true, error {} was detected '
                           'on this machine.'.format(field_prefix)
        })
    ]
    res += enumerated_field(machine,
                            field='{}_error_id'.format(field_prefix),
                            enum_list=mysql_error_ids)

    res += enumerated_field(machine,
                            field='{}_error_message'.format(field_prefix),
                            enum_list=mysql_error_messages)
    return res


def meta_features(machine, field_prefix):
    res = []
    res += enumerated_field(machine,
                            field='{}_server_version'.format(field_prefix),
                            enum_list=mysql_versions,
                            version=True)
    bin_val = int(str(get_field(machine, '{}_protocol_version'.format(field_prefix), t='int')), 2)
    res += [
        Feature(as_obj={
            '_id': '{}_SUPPORT'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': get_field(machine,
                               '{}_supported'.format(field_prefix),
                               t='int'),
            'description': 'If true, {} was detected '
                           'on this machine.'.format(field_prefix)
        }),
        Feature(as_obj={
            '_id': '{}_PROTOCOL_VERSION'.format(field_prefix),
            '_type': 'MACHINE',
            'expansion_safe': True,
            'value': bin_val,
            'description': 'is the protocol version {}?'.format(field_prefix)
        })
    ]
    return res


def extract(machine, args):
    res = []
    protocol = 'mysql'
    ports = [p for c in ports_and_protocols
             if c[0] == protocol
             for p in c[1]]
    for port in sorted(ports, reverse=True):
        field_prefix = 'p{}_{}_banner'.format(port, protocol)
        res += flag_features(machine, field_prefix)
        res += error_features(machine, field_prefix)
        res += meta_features(machine, field_prefix)
        res += tls_f.extract(machine,
                             args=args,
                             field=field_prefix,
                             _id=field_prefix)
    return res


